function Modal() {
   return (
      <div className="fundoModal">
         <div className="addModal">
            <button className="fecharModal">Cancelar</button>
            <form className="formModal">
               <input type="text" name="nome" placeholder=""/>
            </form>
         </div>
      </div>
   )
}

export default Modal
